        position: relative;        
        h1 {
            color: $fontMainColor;
            margin-bottom: 1.563rem;
            }        
        .reservation__new-reservation__under-input {
           margin-top: 1.563rem;
           display: grid;
           grid-template-columns: 25% 25% 50%;
           height: 100%;
           align-items: center;                       
           &__text {               
            font-family: 'Sintony', sans-serif;            
            @include flexCol;             
             border: none solid none none;
