                font-size: 0.813rem;              
                color: $food-slider;
                @include flexEnd;
                }
            }
            &__phone {
                    font-family: 'Dosis', sans-serif; 
                    display: flex;                              
                    justify-content: flex-start;                   
                    a {
                        font-size: 1.5rem;
                        font-weight: bold;
                        color: $fontMainColor;
